class Day extends Component{
    constructor() {
        super();
        this.state = {
          date: new Date().toLocaleString('en-US', {weekday: 'long'}),
          dayTwo:Date.setDate(Date.getDate() + 1)
        };
      }

      render(){

          return (
              <h3>{this.state.date}</h3>
          )
      }
}

export default Day
